import "./App.css";
import { Routes, Route, Link } from "react-router-dom";
import Home from "./Components/Homepage";
import Header from "./Components/Header";

function App() {
  return (
    <div className="App">
      <Header />
<Routes>
     <Route path='/' element={<Home/>}/>
     <Route path='destination' element={<Destination/>}/>
</Routes>
    </div>
  );
}

export default App;
